import React, { useEffect, useState } from "react";
import '../styles/table.css';


function Table() {
    const[elements,setElements] = useState([])
    const[elementsLowerGrid,setElementsLowerGrid] = useState([])

    useEffect(()=>{
     fetch("https://api.npoint.io/de68b6bf88b29ffe56f5")
     .then((response)=> response.json())
     .then((data)=>{
        setElements(data)
        console.log(data)
     })
    },[])

    let lowerGrid = elements.filter((elem) => {return elem.atomicNumber > 20 && elem.atomicNumber <= 57 || elem.atomicNumber >= 72 && elem.atomicNumber <= 89 || elem.atomicNumber >= 104 })

    let lowerElementsList = lowerGrid.map((elem,index)=>{
        return(
            <div key={index} id="elementCard"></div>
        )
    })

    return ( 
      <div id="table">
        {lowerElementsList}
      </div>
     );
}

export default Table;
